import React from "react";
import ReactDom from "react-dom";
import Card from "./Card";
import Mdata from "./Mdata";
import "./index.css";

const hcard = (val) => {
  return(
    <Card 
      imgsrc={val.imgsrc}
      title={val.title}
      fname={val.fname}
      flink={val.flink}
    />
  );
}

ReactDom.render(
  <>
  <h1 className="heading">Hotstar Specials & Latest Movies</h1>
    Mdata.Map(hcard);
  </>, 
 document.getElementById("root")

);
